public static Object[] getRandFields(String[] fields, RandVal[] randVals) {
  Object[] o = new Object[fields.length*2];
  for (int i=0; i<fields.length; i++) {
   o[i*2] = fields[i];
   o[i*2+1] = randVals[i].uval();
  }
  return o;
}

